import React from "react";
///import vaidhya_header_img from "..images/vaidhya_header_img.jpg"
import vaidhyalogo from "../images/vaidhya_header_img.jpg"
function Header(){
    return(
        <nav>
              <img
                src={vaidhyalogo}
                />
            </nav>
    )
}
export default Header
